number;   // period at which the visualisation is updated (every n end of loss)\n\n  // Observable on training events retrieved from TrainerService\n  private trainer$: Observable;\n  private loss$: BehaviorSubject;\n\n  constructor( modelTrainer: TrainerServiceImpl ) {\n    this.modelTrainer = modelTrainer;\n    this.period = 1;\n    this.loss = 0;\n    this.loss$ = new BehaviorSubject(0);\n    // For each TrainData emitted by TrainerService, keep only those corresponding to the\n    // end of an loss and having an loss number multiple of the period\n    this.trainer$ = this.modelTrainer.getTrainer$().pipe(\n      filter(train => train.getEvent() == TrainEvent.EpochEnd && train.getEpoch() % this.period === 0)\n    );\n\n    // For each resulting TrainData, display the loss number\n    this.trainer$.subscribe(\n      data => this.loss$.next(data.getLoss()));\n  }\n  \n  getData$():Observable{\n    return this.loss$;\n  }\n}\n\n\n    \n\n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/ModelComponent.html":{"url":"interfaces/ModelComponent.html","title":"interface - ModelComponent","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  ModelComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/api/core/model/model.component.ts\n        \n\n            \n                Description\n            \n            \n                Component allowing the user to import a model by different means\nThe implementation is chosen by the user dynamically with ModelContainerComponent\n\n            \n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Methods\n                        \n                    \n                    \n                        \n      